  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [userMode, setUserMode] = useState('admin')
  return (
    <div className='main-container'>
      {isLoggedIn && (userMode === 'admin' ? <StudentPage /> : <AdminPage />)}
    </div>
  );
}

export default App;
